    monster?: Monster | null
    title?: string
}

const MonsterBattleCard: React.FC<MonsterCardProps> = ({ title }) => {
    return (
        <BattleMonsterCard centralized>
            <BattleMonsterTitle>{title!}</BattleMonsterTitle>
        </BattleMonsterCard>
    )
}

